package test;

import java.util.TreeSet;

public class LargestInArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		TreeSet<Integer> set = new TreeSet<Integer>();
		set.add(1);
		set.add(5);
		set.add(2);
		set.add(10);
		for(Integer a:set) {
			System.out.println("Set contains"+a);
		}
	}

}
